import {useState,useEffect} from 'react';
let memeslink=[];
const Memes=()=>{
    let [memeslink,setMemeslink]=useState([]);
    var proxyUrl = 'https://cors-anywhere.herokuapp.com/';
    useEffect(()=>{
        fetch(proxyUrl+"http://alpha-meme-maker.herokuapp.com/1").then(res=>res.json()).then((res)=>{
            var n=res['data'].length;
            for(var x=0;x<n;x++){
                memeslink.push(res['data'][x]['image']);
            }
            setMemeslink(memeslink);
        }
        );
    },memeslink);
    return (
        <div>
            {
                memeslink.map((x)=>{
                    return <div> <img src={x} alt="Loading"/> </div>
                })
            }
        </div>
    )
}
export default Memes;
